import './index.css'
function NavBar() {
    return (
        <div id="container">
            <section>
                <img src="../assets/react-logo.svg" alt="React Logo" />
            </section>

            <section>
                <span>Price</span>
                <span>About</span>
                <span>Privacy</span>
            </section>
        </div>
    );
}

function Head() {
    return <h1>Reasons I am excited to learn React</h1>;
}

function Foot() {
    return <small>2025 React</small>;
}

function Page() {
    return (
        <>
            <NavBar />
            <Head />
            <ol>
                <li>React is a popular library, so I will be able to fit in with all the coolest devs out there ðŸ˜Ž</li>
                <li>I am more likely to get a job as a front end developer if I know React</li>
            </ol>
            <Foot />
        </>
    );
}


export default Page;
